class NewStockList(HTMLParser):
	def __init__(self):
		HTMLParser.__init__(self)
		self.shlist=[]
		self.szlist=[]
		self.ulindex=0
		self.findshstock=0
		self.findszstock=0
		self.shnames=[]
		self.sznames=[]

	def handle_starttag(self, tag, attrs):
		if tag=='ul':
			self.ulindex += 1
		if (tag=='a') and (self.ulindex==11):			
			#sh stock
			for x in attrs:				
				if (x[0]=='href') and (x[1].find("sh,60")>-1):
					#get the stock code
					sidx = x[1].find("sh,60")						
					sstr = x[1][sidx:sidx+9]
					self.shlist.append(sstr.replace(',',''))					
					self.findshstock = 1
		if (tag=='a') and (self.ulindex==12):
			for x in attrs:
				if (x[0]=='href') and ('sz,00' in x[1]):
					#get the stock code
					sidx = x[1].find("sz,00")
					sstr = x[1][sidx:sidx+9]
					self.szlist.append(sstr.replace(',',''))
					self.findszstock=1

	def handle_endtag(self, tag):
		if tag=='a':
			self.findshstock=0
			self.findszstock=0
		

	def handle_data(self, data):
		if self.findshstock==1:
			self.shnames.append(data)
		if self.findszstock==1:
			self.sznames.append(data)




